var Dashboard={UserId:function(e){document.getElementById("currentUser").innerHTML=e},Logged:function(){var e=localStorage.getItem("CurrentUser");null==e?document.location="index.html":("admin"!=e&&$("#userAdmin").remove(),Dashboard.UserId(e))}};$(document).ready(function(){Dashboard.Logged(),$("#exit").click(function(){localStorage.removeItem("CurrentUser")})});